# [2197] Replace Non-Coprime Numbers in Array
#

# @lc code=start
from typing import List
from math import gcd, lcm

class Solution:
    def replaceNonCoprimes(self, nums: List[int]) -> List[int]:
        changed = True
        is_reversed = False
        while changed:
            changed = False
            r = []
            i = 0
            while i < len(nums):
                n = nums[i]
                j = i + 1
                while j < len(nums) and gcd(n, nums[j]) > 1:
                    n = lcm(n, nums[j])
                    j += 1
                if j - i > 1:
                    changed = True
                r.append(n)
                i = j
            is_reversed = not is_reversed
            nums = [n for n in reversed(r)]
        return [n for n in reversed(nums)] if is_reversed else nums
# @lc code=end

